jsonSchema working only for the first item of an array of objects<p>I had built an API that was working with NodeJS and express, ones I felt confident with it I learnt Mongo in order to get closer to the MERN stack. Everything is working smoothly and now, just for learning purposes, I'm trying to enforce a schema so that post and put methods are somewhat limited.</p>
<p>My schema works fine except for the <code>colors_available</code> array where the criteria that should be filtering the whole, works only for the first item of the array: <em>(please notice that 'type' has been replaced with 'bsonType' as it's, again, working with MongoDB)</em></p>
<pre><code>colors_available: {
        bsonType: 'array',
        items: [
          {
            bsonType: 'object',
            additionalProperties: false,
            uniqueItems: true,
            minItems: 1,
            required: [
              'color',
              'stock'
            ],
            properties: {
              color: {
                bsonType: 'string'
              },
              stock: {
                bsonType: 'int'
              }
            }
          }
        ]
      }
</code></pre>
<p>As a reference, this is what a document's <code>colors_available</code> field looks like: <em>(the 'colors_available' array could be of any length &gt;=1)</em></p>
<pre><code>&quot;colors_available&quot;: [
    {
      &quot;color&quot;: &quot;Green&quot;,
      &quot;stock&quot;: 42
    },
    {
      &quot;color:&quot;: &quot;Black&quot;,
      &quot;stock&quot;: 13
    },
    {
      &quot;color&quot;: &quot;White&quot;,
      &quot;stock&quot;: 21
    }
  ]
</code></pre>
<p>I have tried removing the squared brackets at the items field but it just broke everything...</p>
<p>Any suggestions are more than welcome! :)</p>

