Go CRUD with Postgres and MongoDB?<p>I'm pretty new to go and backend and I'm in a go internship programme. We built a crud that connects to a psql db, and now I've been told to connect mongoDB which we will use for dev, while PSQL will be used for prod.
Do I have to create new handlers from scratch that I will use for mongo or can I use the same handlers and somehow determine the database type which is being used and use the corresponding logic accordingly?
For example, I have this handler for the user registration endpoint:</p>
<pre><code>func (ctrl *UserController) Register(c *gin.Context) {
    var user models.User
    if err := c.BindJSON(&amp;user); err != nil {
        c.AbortWithStatusJSON(http.StatusUnprocessableEntity, gin.H{
            &quot;error&quot;:   true,
            &quot;message&quot;: err.Error(),
        })
        return
    }
    err := ctrl.userService.Register(&amp;user)
    if err != nil {
        c.AbortWithStatusJSON(http.StatusUnprocessableEntity, gin.H{
            &quot;error&quot;:   true,
            &quot;message&quot;: err.Error(),
        })
        return
    }

    c.JSON(http.StatusCreated, gin.H{
        &quot;message&quot;: &quot;successfully created an user&quot;,
    })
}

func (svc *UserService) Register(user *models.User) error {
    if svc.userRepo.CheckIfEmailExists(user.Email) {
        return errors.New(&quot;user already registered&quot;)
    }
    hash, err := svc.generatePasswordHash(user.Password)
    if err != nil {
        return errors.New(&quot;err can't register user&quot;)
    }

    user.Password = hash

    return svc.userRepo.Insert(user)
}

func (repo *UserRepository) CheckIfEmailExists(mail string) bool {
    var user models.User
    err := repo.dbClient.Debug().Model(models.User{}).Where(&quot;email = ?&quot;, mail).Find(&amp;user).Error
    return errors.Is(err, gorm.ErrRecordNotFound)
}

func (repo *UserRepository) Insert(user *models.User) error {
    err := repo.dbClient.Debug().Model(models.User{}).Create(user).Error
    if err != nil {
        log.Printf(&quot;failed to insert user: %v\n&quot;, err)
        return err
    }
    return nil
}
</code></pre>
<p>I built the insert, register and CheckIfEmailExists functions for mongo:</p>
<pre><code>func (repo *UserRepository) InsertInMongo(user *models.UserB) error {
    coll := repo.mongoClient.DB.Collection(&quot;users&quot;)
    _, err := coll.InsertOne(context.TODO(), user)
    if err != nil {
        log.Printf(&quot;failed to insert user: %v\n&quot;, err)
        return err
    }
    return nil
}

func (svc *UserService) RegisterToMongo(user *models.UserB) error {
    check := svc.userRepo.CheckIfEmailExistsInMongo(user.Email)
    if check {
        return errors.New(&quot;user already registered&quot;)
    }
    hash, err := svc.generatePasswordHash(user.Password)
    if err != nil {
        return errors.New(&quot;err can't register user&quot;)
    }
    user.Password = hash
    return svc.userRepo.InsertInMongo(user)
}

func (repo *UserRepository) CheckIfEmailExistsInMongo(email string) bool {
    coll := repo.mongoClient.Collection
    filter := bson.D{{Key: &quot;email&quot;, Value: email}}

    count, err := coll.CountDocuments(context.TODO(), filter)
    if err != nil {
        panic(err)
    }
    if count != 0 {
        return true
    }
    return false
}
</code></pre>

